const Singleproduct = (propp) =>{
    const { plst } = propp;
    return(
                
            <div class="col-lg-6">
                <div class="product-pic-zo">
                    <img class="product-big-img" src={ plst.image.sourceUrl } alt=""/>
                    <h1>{ plst.name }</h1>
                    <h2>nknknknknknknkkk</h2>
                    <div class="zoom-icon">
                        <i class="fa fa-search-plus"></i>
                    </div>
                </div>
            </div>
           
    );
}
export default Singleproduct;
